import React from "react";
import "./css/style.css";
import logo from './img/logo.png'

const Template1A = () => {
  return (
    <>
      <div className="container">
        <div className="Template1A__container-left">
          <h3>Some sample heading here</h3>
          <p>lorem</p>
        </div>
        <div className="Template1A__container-right">
          <img src={logo} alt="" height="100px" width="100px"/>
        </div>
      </div>
    </>
  );
};

const Templates = () => {
  return (
    <div>
      <Template1A />
    </div>
  );
};

export default Templates;
